const fs = require('fs');
const readline = require('readline');
const { performance } = require('perf_hooks');

const EARTH_RADIUS = 6371.0087455872; // Earth radius in kilometers
const MAX_DEPTH = 1000; // Maximum recursion depth limit

class Region {
    constructor(up, bottom, left, right) {
        this.up = up;
        this.bottom = bottom;
        this.left = left;
        this.right = right;
    }
}

class ElePoint {
    constructor(lat, lng, time, index) {
        this.lat = lat; // Latitude
        this.lng = lng; // Longitude
        this.time = time; // Time
        this.index = index; // Index
    }
}

class QuadTreeNode {
    constructor(depth, region) {
        this.depth = depth;
        this.is_leaf = true;
        this.region = region;
        this.LU = null; // Left-upper child node pointer
        this.LB = null; // Left-bottom child node pointer
        this.RU = null; // Right-upper child node pointer
        this.RB = null; // Right-bottom child node pointer
        this.ele_num = 0; // Number of location points
        this.ele_list = []; // List of location points
    }
}

class Point {
    constructor(lat, lon, index) {
        this.lat = lat;
        this.lon = lon;
        this.index = index;
    }
}

function deg2rad(deg) {
    return deg * (Math.PI / 180);
}

function haversine(p1, p2) {
    const dLat = deg2rad(p2.lat - p1.lat);
    const dLng = deg2rad(p2.lng - p1.lng);
    const a = Math.sin(dLat / 2) * Math.sin(dLat / 2) +
        Math.cos(deg2rad(p1.lat)) * Math.cos(deg2rad(p2.lat)) *
        Math.sin(dLng / 2) * Math.sin(dLng / 2);
    const c = 2 * Math.atan2(Math.sqrt(a), Math.sqrt(1 - a));
    return EARTH_RADIUS * c;
}

function cal_time_dis(p1, p2) {
    const time_dis = Math.abs(p1.timestamp - p2.timestamp) / 86400;
    return time_dis;
}

function insertEle(node, ele) {
    if (node.depth > MAX_DEPTH) {
        console.error("Exceeded maximum depth");
        return;
    }

    if (node.is_leaf) {
        if (node.ele_num >= 90) {
            splitNode(node);
            insertEle(node, ele);
        } else {
            node.ele_list.push(ele);
            node.ele_num++;
        }
        return;
    }

    const mid_vertical = (node.region.up + node.region.bottom) / 2;
    const mid_horizontal = (node.region.left + node.region.right) / 2;

    if (ele.lat > mid_vertical) {
        if (ele.lng > mid_horizontal) {
            insertEle(node.RU, ele);
        } else {
            insertEle(node.LU, ele);
        }
    } else {
        if (ele.lng > mid_horizontal) {
            insertEle(node.RB, ele);
        } else {
            insertEle(node.LB, ele);
        }
    }
}

function createChildNode(node, bottom, up, left, right) {
    const depth = node.depth + 1;
    const region = new Region(up, bottom, left, right);
    const childNode = new QuadTreeNode(depth, region);
    return childNode;
}

function splitNode(node) {
    const mid_vertical = (node.region.up + node.region.bottom) / 2;
    const mid_horizontal = (node.region.left + node.region.right) / 2;

    node.is_leaf = false;
    node.RU = createChildNode(node, mid_vertical, node.region.up, mid_horizontal, node.region.right);
    node.LU = createChildNode(node, mid_vertical, node.region.up, node.region.left, mid_horizontal);
    node.RB = createChildNode(node, node.region.bottom, mid_vertical, mid_horizontal, node.region.right);
    node.LB = createChildNode(node, node.region.bottom, mid_vertical, node.region.left, mid_horizontal);

    for (let i = 0; i < node.ele_num; i++) {
        insertEle(node, node.ele_list[i]);
    }
    node.ele_num = 0; // Reset count
}

function isInRange(center, point, radius) {
    return haversine(center, point) <= radius;
}

function queryEle(node, center, radius, results, result_count) {
    if (node.depth > MAX_DEPTH) {
        console.error("Exceeded maximum depth");
        return;
    }

    if (node.is_leaf) {
        for (let j = 0; j < node.ele_num; j++) {
            if (isInRange(center, node.ele_list[j], radius)) {
                results[result_count[0]] = node.ele_list[j];
                result_count[0]++;
            }
        }
        return;
    }

    const mid_vertical = (node.region.up + node.region.bottom) / 2;
    const mid_horizontal = (node.region.left + node.region.right) / 2;

    if (center.lat + radius > mid_vertical) {
        if (center.lng + radius > mid_horizontal) {
            queryEle(node.RU, center, radius, results, result_count);
        }
        if (center.lng - radius < mid_horizontal) {
            queryEle(node.LU, center, radius, results, result_count);
        }
    }
    if (center.lat - radius < mid_vertical) {
        if (center.lng + radius > mid_horizontal) {
            queryEle(node.RB, center, radius, results, result_count);
        }
        if (center.lng - radius < mid_horizontal) {
            queryEle(node.LB, center, radius, results, result_count);
        }
    }
}

function cross(O, A, B) {
    return (A.lon - O.lon) * (B.lat - O.lat) - (A.lat - O.lat) * (B.lon - O.lon);
}

function convexHull(points) {
    const n = points.length;
    const hull = new Array(2 * n);
    const peak = [];

    if (n <= 3) {
        for (let i = 0; i < n; i++) peak.push(points[i].index);
        return peak;
    }

    points.sort((a, b) => a.lon < b.lon || (a.lon === b.lon && a.lat < b.lat));

    let k = 0;
    for (let i = 0; i < n; ++i) {
        while (k >= 2 && cross(hull[k - 2], hull[k - 1], points[i]) <= 0) k--;
        hull[k++] = points[i];
    }

    for (let i = n - 1, t = k + 1; i > 0; --i) {
        while (k >= t && cross(hull[k - 2], hull[k - 1], points[i - 1]) <= 0) k--;
        hull[k++] = points[i - 1];
    }

    for (let i = 0; i < k - 1; i++) {
        peak.push(hull[i].index);
    }

    return peak;
}

const arr = [];
const mp = new Map(); // Statistical clustering result set
const CorePoints = [];
const mmp = new Map(); // Delete unused aggregation points | Points already in N
const peaks = []; // Top corner
const peakmap = new Map(); // Mark

function T_DBSCAN(EPS, MinTime, maxTime, number) {
    const visited = new Array(number).fill(0);
    const unvisited = Array.from({ length: number }, (_, i) => i);

    for (let i = 0; i < number; i++) {
        mp.set(i, -1);
    }

    let k = -1;
    while (unvisited.length > 0) {
        const p = arr[unvisited[0]];
        visited[unvisited[0]] = 1;
        unvisited.shift(); // Mark as visited, remove from unvisited

        const EpsResults = [];
        const point = new ElePoint(p.lat, p.lng, p.timestamp, p.index);
        let max_stay_time = 0;
        const result_count = [0];
        queryEle(root, point, EPS, EpsResults, result_count);

        const vis_temp = [];
        for (let i = 0; i < result_count[0]; i++) {
            if (!visited[EpsResults[i].index]) {
                const dis_time = cal_time_dis(p, arr[EpsResults[i].index]);
                if (dis_time < maxTime) {
                    max_stay_time = Math.max(max_stay_time, dis_time);
                } else {
                    vis_temp.push(EpsResults[i].index); // Temporarily store, mark as core point
                }
            }
        }

        if (max_stay_time >= MinTime) {
            for (const v of vis_temp) visited[v] = 1;

            k = k + 1; // Add a new cluster
            mp.set(p.index, k);
            const points = []; // Place valid neighborhood points for convex hull processing
            const EpsPoints = []; // Store neighborhood vertices
            for (let i = 0; i < result_count[0]; i++) {
                if (!visited[EpsResults[i].index]) { // Exclude interference points
                    points.push(new Point(EpsResults[i].lat, EpsResults[i].lng, EpsResults[i].index));
                }
            }
            peaks.length = 0;
            peaks.push(...convexHull(points)); // Find convex hull vertices
            for (const v of peaks) peakmap.set(v, 1); // Mark to retain vertex mark, mark other points as visited and cluster mark
            mmp.clear(); // mmp is used to count the points in the neighborhood of p that need to be expanded
            for (let i = 0; i < result_count[0]; i++) {
                if (!peakmap.has(EpsResults[i].index)) {
                    visited[EpsResults[i].index] = 1;
                    mp.set(EpsResults[i].index, k);
                } else {
                    EpsPoints.push(new ElePoint(EpsResults[i].lat, EpsResults[i].lng, EpsResults[i].time, EpsResults[i].index));
                    mmp.set(EpsResults[i].index, 1);
                }
            }
            peaks.length = 0;
            peakmap.clear();
            points.length = 0; // Clear containers
            let cmp_time = max_stay_time; // Statistical maximum time for this cluster

            for (let i = 0; i < EpsPoints.length; i++) {
                const q = arr[EpsPoints[i].index];
                if (!visited[q.index]) {
                    if (mp.get(q.index) === -1) mp.set(q.index, k);
                    visited[q.index] = 1;
                    let cmp_temp_time = cmp_time;
                    const pointResults = [];
                    const temp_point = new ElePoint(q.lat, q.lng, q.timestamp, q.index);
                    max_stay_time = 0;
                    const temp_count = [0];
                    queryEle(root, temp_point, EPS, pointResults, temp_count);
                    for (let j = 0; j < temp_count[0]; j++) {
                        if (!visited[pointResults[j].index]) {
                            const temp_dis_time = cal_time_dis(q, arr[pointResults[j].index]);
                            const temp_cmp_time = cal_time_dis(p, arr[pointResults[j].index]);
                            if (temp_cmp_time < maxTime && temp_dis_time < maxTime) {
                                max_stay_time = Math.max(temp_dis_time, max_stay_time);
                                cmp_temp_time = Math.max(cmp_temp_time, temp_cmp_time);
                            }
                        }
                    }

                    if (max_stay_time >= MinTime) {
                        cmp_time = Math.max(cmp_temp_time, cmp_time);
                        for (let j = 0; j < temp_count[0]; j++) {
                            if (!mmp.has(pointResults[j].index) && !visited[pointResults[j].index]) {
                                points.push(new Point(pointResults[j].lat, pointResults[j].lng, pointResults[j].index));
                            }
                        }
                        peaks.length = 0;
                        peaks.push(...convexHull(points)); // Find convex hull vertices
                        for (const v of peaks) peakmap.set(v, 1);
                        for (let j = 0; j < temp_count[0]; j++) {
                            if (!mmp.has(pointResults[j].index) && !peakmap.has(pointResults[j].index)) {
                                visited[pointResults[j].index] = 1;
                                if (mp.get(pointResults[j].index) === -1) mp.set(pointResults[j].index, k);
                            } else {
                                EpsPoints.push(new ElePoint(pointResults[j].lat, pointResults[j].lng, pointResults[j].time, pointResults[j].index));
                                mmp.set(EpsResults[i].index, 1);
                            }
                        }
                    }
                    peaks.length = 0;
                    peakmap.clear();
                    points.length = 0; // Clear containers
                }
            }

            unvisited.length = 0;
            for (let i = 0; i < number; i++) if (!visited[i]) unvisited.push(i);
            CorePoints.push({ index: p.index, time: cmp_time });
        } else {
            mp.set(p.index, -1); // Mark p as a noise point
        }
        vis_temp.length = 0; // Clear temporary interference point mark
    }
}

function stringToTimestamp(dateTimeStr, format = "%Y/%m/%d %H:%M:%S") {
    const tm = {};
    const ss = new Date(dateTimeStr);
    const [datePart, timePart] = dateTimeStr.split(' ');
    const [year, month, day] = datePart.split('/').map(Number);
    const [hour, minute, second] = timePart.split(':').map(Number);
    tm.year = year;
    tm.month = month - 1; // JavaScript months are 0-based
    tm.day = day;
    tm.hour = hour;
    tm.minute = minute;
    tm.second = second;

    const timestamp = new Date(year, month - 1, day, hour, minute, second).getTime() / 1000;
    return timestamp;
}

const root_region = new Region(-90, 90, -180, 180);
const root = new QuadTreeNode(0, root_region);

const fileName = "C:\\Users\\何心武\\Desktop\\T-DBSCAN聚类\\灰鹤位点all - 副本.csv";
const csv_data = fs.createReadStream(fileName);
const rl = readline.createInterface({
    input: csv_data,
    crlfDelay: Infinity
});

let i = 0;
rl.on('line', (line) => {
    if (i === 0) {
        i++;
        return; // Skip header line
    }
    const words = line.split(',');
    const ep = new ElePoint();
    ep.time = stringToTimestamp(words[0]);
    ep.lat = parseFloat(words[1]);
    ep.lng = parseFloat(words[2]);
    ep.index = i++;
    const p = { index: ep.index, lat: ep.lat, lng: ep.lng, timestamp: ep.time };
    arr.push(p);
    insertEle(root, ep);
});

rl.on('close', () => {
    const beforeTime = performance.now();
    T_DBSCAN(25, 3, 130, i);
    const afterTime = performance.now();
    console.log("总耗时:");
    const duration_millsecond = afterTime - beforeTime;
    console.log(duration_millsecond + "毫秒");
    console.log("完成聚合，核心点点数为：" + CorePoints.length);
    for (const p of CorePoints) {
        let num = 0;
        for (const u of mp.values()) {
            if (u === mp.get(arr[p.index].index)) {
                ++num;
            }
        }
        console.log(`${arr[p.index].index}  ${arr[p.index].lat}  ${arr[p.index].lng}  ${p.time} ${num}`);
    }
});

export function convertDateStringToUnix(dateString) {  
    // 尝试使用 Date 构造函数解析日期字符串  
    const date = new Date(dateString)
    // 返回 Unix 时间戳（毫秒）  
    return date.getTime()/1000
}
